import React from 'react'

const AanbodDtl = () => {
  const [formData, setFormData] = useState({
    voornaam: '',
    achternaam: '',
    telefoon: '',
    email: '',
    bericht: ''
  });

  const [errors, setErrors] = useState({});
  const [touched, setTouched] = useState({});
  const [isSubmitting, setIsSubmitting] = useState(false);

  // Validation patterns
  const patterns = {
    telefoon: /^[0-9+\-\s()]{10,}$/,
    email: /^[^\s@]+@[^\s@]+\.[^\s@]+$/
  };

  // Error messages
  const errorMessages = {
    voornaam: 'Voornaam is verplicht (minimaal 2 karakters)',
    achternaam: 'Achternaam is verplicht (minimaal 2 karakters)',
    telefoon: 'Voer een geldig telefoonnummer in',
    email: 'Voer een geldig e-mailadres in',
    bericht: 'Bericht is verplicht (minimaal 10 karakters)'
  };

  // Validate individual field
  const validateField = (name, value) => {
    let error = '';

    if (!value.trim()) {
      error = `${name.charAt(0).toUpperCase() + name.slice(1)} is verplicht`;
    } else {
      switch (name) {
        case 'voornaam':
        case 'achternaam':
          if (value.length < 2) {
            error = errorMessages[name];
          }
          break;
        case 'telefoon':
          if (!patterns.telefoon.test(value)) {
            error = errorMessages.telefoon;
          }
          break;
        case 'email':
          if (!patterns.email.test(value)) {
            error = errorMessages.email;
          }
          break;
        case 'bericht':
          if (value.length < 10) {
            error = errorMessages.bericht;
          }
          break;
        default:
          break;
      }
    }

    return error;
  };

  // Validate all fields
  const validateForm = () => {
    const newErrors = {};
    
    Object.keys(formData).forEach(key => {
      const error = validateField(key, formData[key]);
      if (error) {
        newErrors[key] = error;
      }
    });

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  // Handle input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));

    // Real-time validation after user has touched the field
    if (touched[name]) {
      const error = validateField(name, value);
      setErrors(prev => ({
        ...prev,
        [name]: error
      }));
    }
  };

  // Handle blur event
  const handleBlur = (e) => {
    const { name, value } = e.target;
    
    setTouched(prev => ({
      ...prev,
      [name]: true
    }));

    const error = validateField(name, value);
    setErrors(prev => ({
      ...prev,
      [name]: error
    }));
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Mark all fields as touched
    const allTouched = {};
    Object.keys(formData).forEach(key => {
      allTouched[key] = true;
    });
    setTouched(allTouched);

    // Validate form
    const isValid = validateForm();
    
    if (isValid) {
      setIsSubmitting(true);
      
      try {
        // Here you would typically send the data to your API
        await submitFormData(formData);
        
        // Success handling
        alert('Bedankt voor uw bericht! We nemen zo spoedig mogelijk contact met u op.');
        
        // Reset form
        setFormData({
          voornaam: '',
          achternaam: '',
          telefoon: '',
          email: '',
          bericht: ''
        });
        setErrors({});
        setTouched({});
        
      } catch (error) {
        alert('Er is een fout opgetreden. Probeer het later opnieuw.');
      } finally {
        setIsSubmitting(false);
      }
    } else {
      // Scroll to first error
      const firstErrorField = document.querySelector('.error');
      if (firstErrorField) {
        firstErrorField.scrollIntoView({ behavior: 'smooth', block: 'center' });
      }
    }
  };

  // Mock function to submit form data
  const submitFormData = async (data) => {
    // Replace this with your actual API call
    console.log('Submitting form data:', data);
    
    // Simulate API call
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve({ success: true });
      }, 1000);
    });
  };

  // Helper function to get input className
  const getInputClassName = (fieldName) => {
    if (!touched[fieldName]) return 'form-control form-styl';
    
    return errors[fieldName] 
      ? 'form-control form-styl error' 
      : 'form-control form-styl valid';
